import infoCSS from './Info.module.css'


const Info = () => {
    return (
        <div className={infoCSS.info}>
            <img src='https://railsware.com/blog/wp-content/uploads/2019/07/Why-we-use-ReactJS-for-our-projects-Icon.png'></img>
            <h3>Jayamkay</h3><br/>
            <p>Date of Birth: 4 June</p>
        </div>
    )
}
